// ==UserScript==
// @name         一键返回顶部-Return Top
// @name:zh      一键返回顶部
// @name:zh-CN   一键返回顶部
// @namespace    https://greasyfork.org/zh-CN/scripts/432151
// @version      0.3
// @description  一键返回顶部.提供位置,背景,大小切换. 提示: 如需支持文件网址,需要给扩展访问文件网址的权限.
// @author       pruidong
// @match        *://*/*
// @match        *:///*:/*
// @icon         data:image/png;base64,
// @require      https://cdn.bootcdn.net/ajax/libs/jquery/3.6.0/jquery.min.js
// @grant        GM_getValue
// @grant        GM_setValue
// @grant        GM_registerMenuCommand
// @grant        GM_unregisterMenuCommand
// @grant        GM_openInTab
// @noframes
// @connect     cdn.bootcdn.net
// @license     GPL-3.0-or-later
// @run-at      document-end
// ==/UserScript==
(function() {
    'use strict';
    let returnImg1={},returnImg2={},returnImg3={};
    let background=GM_getValue("BACKGROUND",1); /// 背景样式.
    let position=GM_getValue("POSITION",4); /// 图标位置
    let imageSize=GM_getValue("IMAGESIZE","48"); /// 图标尺寸
    let autoHideBtn=GM_getValue("AUTOHIDEBTN","Y"); /// 默认隐藏,下拉超过距离再显示按钮.默认设置: 隐藏,超过指定距离才显示按钮.
    returnImg1["48"]="data:image/png;base64,";
    returnImg1["64"]="data:image/png;base64,";
    returnImg1["128"]="data:image/png;base64,";
    returnImg1["200"]="data:image/png;base64,";

    returnImg2["48"]="data:image/png;base64,";
    returnImg2["64"]="data:image/png;base64,";
    returnImg2["128"]="data:image/png;base64,";
    returnImg2["200"]="data:image/png;base64,";

    returnImg3["48"]="data:image/png;base64,";
    returnImg3["64"]="data:image/png;base64,";
    returnImg3["128"]="data:image/png;base64,";
    returnImg3["200"]="data:image/png;base64,";
    let backgroundSetting="";
    let setBackgroundValue=2;
    let setBackgroundTitle="二";
    switch(background){
        case 1:
            backgroundSetting=returnImg1[imageSize];
            setBackgroundValue=2;
            setBackgroundTitle="二"
            break;
        case 2:
            backgroundSetting=returnImg2[imageSize];
            setBackgroundValue=3;
            setBackgroundTitle="三"
            break;
        case 3:
            backgroundSetting=returnImg3[imageSize];
            setBackgroundValue=1;
            setBackgroundTitle="一";
            break;
        default:
            backgroundSetting=returnImg1["48"];
            setBackgroundValue=1;
            setBackgroundTitle="一"
            break;
    }
    let nextImageSize="64";
    let nextImageSizeTitle="中";
    switch(imageSize){
        case "48":
            nextImageSize="64";
            nextImageSizeTitle="中";
            break;
        case "64":
            nextImageSize="128";
            nextImageSizeTitle="大";
            break;
        case "128":
            nextImageSize="200";
            nextImageSizeTitle="超大";
            break;
        case "200":
            nextImageSize="48";
            nextImageSizeTitle="小";
            break;
        default:
            nextImageSize="48";
            nextImageSizeTitle="小";
    }
    let positionClass="bottom:5%;right:5%;";
    let nextPositionTitle="左上";
    let nextPosition=1;
    switch(position){
        case 1: /// 左上
            positionClass="top:5%;left:5%;";
            nextPositionTitle="左下";
            nextPosition=2;
            break;
        case 2:/// 左下
            positionClass="bottom:5%;left:5%;";
            nextPositionTitle="右上";
            nextPosition=3;
            break;
        case 3: /// 右上
            positionClass="top:5%;right:5%;";
            nextPositionTitle="右下";
            nextPosition=4;
            break;
        case 4:/// 右下
            positionClass="bottom:5%;right:5%;";
            nextPositionTitle="左上";
            nextPosition=1;
            break;
        default:
            positionClass="bottom:5%;right:5%;";
            nextPositionTitle="左上";
            nextPosition=1;
    }
    const html=`<div class='ReturnTopUserScript55658905' style='position:fixed;${positionClass}border-radius:5px;z-index:100000;'><div style='width:${parseInt(imageSize)}px;height:${parseInt(imageSize)}px;background:url(${backgroundSetting}) no-repeat;background-size: auto;' class='returnTopUserScript656569895'></div></div>`;
    $("body").append(html);
    if(autoHideBtn=="Y"){
        $(".ReturnTopUserScript55658905,.returnTopUserScript656569895").hide();
        $(window).scroll(function(){
            const scrollTop=$(window).scrollTop();
            $(".ReturnTopUserScript55658905,.returnTopUserScript656569895").hide();
            if(scrollTop>500){
                $(".ReturnTopUserScript55658905,.returnTopUserScript656569895").show();
            }
        })
    }

    let menu_feedBack_ID=null,menu_background_ID=null,menu_imageSize_ID=null,menu_position_ID=null,menu_defaultSetting_ID=null,auto_hideBtn_ID=null;
    registerMenuCommand();
    const speed = 1000;//自定义滚动速度;
    $(".ReturnTopUserScript55658905,.returnTopUserScript656569895").click(function(){
       $("html,body,div").animate({ "scrollTop" : 0 }, speed);
    });
    // 注册脚本菜单
    function registerMenuCommand() {
        if (menu_feedBack_ID) { // 如果反馈菜单ID不是 null，则删除所有脚本菜单
            GM_unregisterMenuCommand(menu_feedBack_ID);
            GM_unregisterMenuCommand(menu_background_ID);
            GM_unregisterMenuCommand(menu_imageSize_ID);
            GM_unregisterMenuCommand(menu_position_ID);
            GM_unregisterMenuCommand(menu_defaultSetting_ID);
            GM_unregisterMenuCommand(auto_hideBtn_ID);
        }
       menu_background_ID = GM_registerMenuCommand(`切换背景: 第${setBackgroundTitle}`, function () {
            window.GM_setValue("BACKGROUND",setBackgroundValue);
            alert(`切换到第${setBackgroundTitle}套背景!`);
			location.reload();
        });
        menu_imageSize_ID = GM_registerMenuCommand(`切换背景尺寸: ${nextImageSizeTitle}`, function () {
            window.GM_setValue("IMAGESIZE",nextImageSize);
            alert(`切换背景尺寸: ${nextImageSizeTitle}`);
			location.reload();
        });
        menu_position_ID = GM_registerMenuCommand(`切换元素位置: ${nextPositionTitle}`, function () {
            window.GM_setValue("POSITION",nextPosition);
            alert(`切换元素位置: ${nextPositionTitle}`);
			location.reload();
        });
        auto_hideBtn_ID=GM_registerMenuCommand(`默认隐藏按钮(下拉超过指定距离显示): ${autoHideBtn=="Y"?"否":"是"}`, function () {
            const nextAutoHideBtn=autoHideBtn=="Y"?"N":"Y";
            window.GM_setValue("AUTOHIDEBTN",nextAutoHideBtn);
            alert(`默认隐藏按钮(下拉超过指定距离显示): ${autoHideBtn=="Y"?"否":"是"}`);
			location.reload();
        });
         menu_defaultSetting_ID = GM_registerMenuCommand(`恢复默认设置`, function () {
            window.GM_setValue("BACKGROUND",1);
            window.GM_setValue("IMAGESIZE","48");
            window.GM_setValue("POSITION",4);
            alert(`恢复默认设置成功!`);
			location.reload();
        });
        menu_feedBack_ID = GM_registerMenuCommand(' 反馈 & 建议 [Github]', function () {window.GM_openInTab('https://github.com/pruidong/UserScript', {active: true,insert: true,setParent: true});window.GM_openInTab('https://greasyfork.org/zh-CN/scripts/432151/feedback', {active: true,insert: true,setParent: true});});
    }
})();
